        """
        :type h: int
        :type n: int
        :rtype: int
        """
        if h == 1:
            return 1
        else:
            return self.nodesVisited(h - 1, n / 2) + self.nodesVisited(h - 1, n / 2 + n % 2)

class Solution(object):
    def nodesVisited(self, h, n):
        """
        :type h: int
        :type n: int
        :rtype: int
        """
        if h == 1:
            return 1
        else:
            return 2 ** (h - 1) + self.nodesVisited(h - 1, n - 2 ** (h - 1))

